import React from "react";
import { ReactDOM } from "react";

const change = () => {
   if (change){
       const toggle = 'Aberto'
   } else {
       const toggle = 'Fechado'
   }

}

const headerBody = (toggle) => {

    return (
        <div class='headerBody'>
                <img  class ='HBImage' src='https://thumbs.dreamstime.com/b/italian-pizza-fresh-salad-red-wine-wide-composition-party-dinner-flat-lay-various-kinds-glasses-over-rustic-wooden-table-174281796.jpg' />
            <div class='imgFooter'>
                <div class = 'IFTime'>
                    <p>Pizzas!</p>
                </div>
                <div class='status'>
                    <button id="myButton" onToggle={change}><p>{toggle}</p></button>
                </div>
            </div>
        </div>
    )
}

export default headerBody;
